- input: "TEXT\x1CC00444125\x1C.TEXT\x1C\x1CF3A\x1CThis report is being ammended to
    correct a clerical mistake.  On 03/20/2008 the Salary payments for Peter Hill
    and Kenneth Mayville for the amount of $1750.00 each were counted twice.  Both
    individual items reflect the same check number for the duplicate payments for
    each individual.  The disbursment to BrabenderCox on 03/06/2008 in the amount
    of $4530.00 was added to this report because it was missed in the original report.
    These were clerical mistakes, and an overlooked by the treasurer.  In the future
    efforts will be made to be more dilligant.\n"
